import * as React from 'react';
import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    container: {
        justifyContent: 'center',
        alignItems: 'center',
        flex: 1,
        backgroundColor: 'black',
    },
    scrollContainer: {
        flexGrow: 1,
        alignItems: 'center',
        backgroundColor: 'black',
    },
    queryView: {
        backgroundColor: '#1e2022',
        marginBottom: 10,
        padding: 10,
    },
    header: {
        fontSize: 50,
        marginTop: 200,
        marginBottom: 15,
        color: 'white',
    },
    articleText: {
        fontSize: 25,
        marginTop: 10,
        marginBottom: 10,
        marginLeft: 10,
        color: 'white',
    },
    subArticleText: {
        fontSize: 20,
        marginBottom: 10,
        marginLeft: 10,
        color: '#9ea6ad',
    },
    subArticleSource: {
        fontSize: 20,
        marginBottom: 10,
        marginLeft: 10,
        color: '#a769ff',
    },
    subArticleConservative: {
        fontSize: 20,
        marginBottom: 10,
        marginLeft: 10,
        color: 'red',
    },
    subArticleLiberal: {
        fontSize: 20,
        marginBottom: 10,
        marginLeft: 10,
        color: '#6987ff',
    },
    subArticleLink: {
        fontSize: 20,
        marginBottom: 10,
        marginLeft: 10,
        color: '#2d6ff4',
    },
    AIText: {
        fontSize: 20,
        marginBottom: 10,
        marginLeft: 10,
        color: '#34c9eb',
    }
});
